description:
Verenigde Staten
Drama / Thriller
84 minuten

goed

met Lou Taylor Pucci, Chris Pine en Piper Perabo

Vier jongeren rijden door de woestijn richting de kust. Ze proberen te vluchten voor een uitgebroken virus dat de hele wereld in 
zijn greep heeft. Vastbesloten om aan het virus te ontsnappen reizen Danny, zijn broer Brian, en hun vriendinnen Bobby en Kate 
zo snel als ze kunnen richting het zuidwesten van de V.S. Na vier dagen staan ze voor grote morele beslissingen. Ze ontdekken 
dat het virus niet de grootste vijand is, maar de duistere kant in henzelf.
